import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Line, Bar } from 'react-chartjs-2';
import { Chart, registerables } from 'chart.js';
Chart.register(...registerables);

const FinanceDashboard = () => {
  const [sales, setSales] = useState([]);
  const [incomeStatements, setIncomeStatements] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const salesResponse = await axios.get('http://localhost:5000/api/sales');
        setSales(salesResponse.data);

        const incomeResponse = await axios.get('http://localhost:5000/api/income');
        setIncomeStatements(incomeResponse.data);
      } catch (err) {
        setError('Failed to fetch data');
        console.error(err);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  // Calculate total sales from all records
  const totalSales = sales.reduce((accumulator, sale) => accumulator + sale.totalAmount, 0);

  // Prepare data for the line chart (Net Income Over Time)
  const lineChartData = {
    labels: incomeStatements.map(statement => `${statement.month}/${statement.year}`),
    datasets: [
      {
        label: 'Net Income',
        data: incomeStatements.map(statement => statement.netIncome),
        fill: false,
        backgroundColor: 'rgb(75, 192, 192)',
        borderColor: 'rgba(75, 192, 192, 0.2)',
      },
    ],
  };

  const lineChartOptions = {
    responsive: true,
    plugins: {
      title: {
        display: true,
        text: 'Net Income Over Time',
      },
    },
    scales: {
      y: {
        beginAtZero: true,
      },
    },
  };

  // Prepare data for the bar chart (Sales vs Expenses)
  const barChartData = {
    labels: incomeStatements.map(statement => `${statement.month}/${statement.year}`),
    datasets: [
      {
        label: 'Total Sales',
        data: incomeStatements.map(statement => statement.totalSales),
        backgroundColor: 'rgba(54, 162, 235, 0.5)', // Blue
      },
      {
        label: 'Total Expenses',
        data: incomeStatements.map(statement => statement.totalExpenses),
        backgroundColor: 'rgba(255, 99, 132, 0.5)', // Red
      },
    ],
  };

  const barChartOptions = {
    responsive: true,
    plugins: {
      title: {
        display: true,
        text: 'Total Sales vs. Total Expenses',
      },
    },
    scales: {
      y: {
        beginAtZero: true,
      },
    },
  };

  const styles = {
    container: {
      padding: '30px',
      fontFamily: 'Arial, sans-serif',
    },
    title: {
      fontSize: '40px',
      fontWeight: 'bold',
      marginBottom: '30px',
      textAlign: 'center',
      color: '#374151',
    },
    loading: {
      textAlign: 'center',
    },
    section: {
      backgroundColor: '#ffffff',
      padding: '30px',
      borderRadius: '20px',
      boxShadow: '0px 8px 20px rgba(0,0,0,0.15)',
      marginBottom: '50px',
      maxWidth: '800px',
      marginLeft: 'auto',
      marginRight: 'auto',
    },
    sectionTitle: {
      fontSize: '30px',
      marginBottom: '20px',
    },
    totalSales: {
      fontSize: '24px',
      fontWeight: 'bold',
    },
    table: {
      width: '100%',
      textAlign: 'center',
      borderCollapse: 'collapse',
    },
    tableHeader: {
      backgroundColor: '#93c5fd',
      padding: '12px',
    },
    tableCell: {
      padding: '10px',
      borderBottom: '1px solid #eee',
    },
    noData: {
      padding: '20px',
      textAlign: 'center',
      fontStyle: 'italic',
      color: '#777',
    },
    error: {
      color: 'red',
      marginBottom: '10px',
      textAlign: 'center',
    },
    chartContainer: {
      marginBottom: '30px', // Increased spacing for better visual separation
    },
  };

  return (
    <div style={styles.container}>
      <h2 style={styles.title}>Finance Dashboard</h2>
      <p style={{ textAlign: 'center', marginBottom: '30px' }}>
        Welcome, Finance team. Here you can manage financial records.
      </p>

      {loading ? (
        <p style={styles.loading}>Loading financial data...</p>
      ) : error ? (
        <p style={styles.error}>{error}</p>
      ) : (
        <>
          {/* Total Sales Section */}
          <div style={styles.section}>
            <h3 style={styles.sectionTitle}>Total Sales</h3>
            <p style={styles.totalSales}>${totalSales.toFixed(2)}</p>
          </div>

          {/* Sales History Section */}
          <div style={styles.section}>
            <h3 style={styles.sectionTitle}>Sales History</h3>
            <table style={styles.table}>
              <thead>
                <tr>
                  <th style={styles.tableHeader}>Product</th>
                  <th style={styles.tableHeader}>Quantity Sold</th>
                  <th style={styles.tableHeader}>Total Amount</th>
                  <th style={styles.tableHeader}>Date Sold</th>
                </tr>
              </thead>
              <tbody>
                {sales.map((sale, index) => (
                  <tr key={index}>
                    <td style={styles.tableCell}>{sale.product?.name || 'Unknown'}</td>
                    <td style={styles.tableCell}>{sale.quantitySold}</td>
                    <td style={styles.tableCell}>${sale.totalAmount.toFixed(2)}</td>
                    <td style={styles.tableCell}>{new Date(sale.saleDate).toLocaleString()}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>

          {/* Income Statements Section */}
          <div style={styles.section}>
            <h3 style={styles.sectionTitle}>Income Statements</h3>
            {incomeStatements.length === 0 ? (
              <p style={styles.noData}>No income statements available.</p>
            ) : (
              <>
                {/* Line Chart (Net Income Over Time) */}
                <div style={styles.chartContainer}>
                  <Line data={lineChartData} options={lineChartOptions} />
                </div>

                {/* Bar Chart (Sales vs Expenses) */}
                <div style={styles.chartContainer}>
                  <Bar data={barChartData} options={barChartOptions} />
                </div>

                <table style={styles.table}>
                  <thead>
                    <tr>
                      <th style={styles.tableHeader}>Month</th>
                      <th style={styles.tableHeader}>Year</th>
                      <th style={styles.tableHeader}>Total Sales</th>
                      <th style={styles.tableHeader}>Total Expenses</th>
                      <th style={styles.tableHeader}>Net Income</th>
                    </tr>
                  </thead>
                  <tbody>
                    {incomeStatements.map((statement) => (
                      <tr key={statement._id}>
                        <td style={styles.tableCell}>{statement.month}</td>
                        <td style={styles.tableCell}>{statement.year}</td>
                        <td style={styles.tableCell}>{statement.totalSales}</td>
                        <td style={styles.tableCell}>{statement.totalExpenses}</td>
                        <td style={styles.tableCell}>{statement.netIncome}</td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              </>
            )}
          </div>
        </>
      )}
    </div>
  );
};

export default FinanceDashboard;
